import CY2_SPREADSHEET:Workbook;

Local string &path = "c:\temp\test.xlsx";
Local File &file = GetFile(&path, "W", "A", %FilePath_Absolute);
If &file.IsOpen Then
   &file.Delete();
   &file.Close();
End-If;
&file = Null;

Local CY2_SPREADSHEET:Workbook &sheet = create CY2_SPREADSHEET:Workbook(&path);
&sheet.RenameCurrentSheet("test");
&sheet.SetCellString(1, 1, "test");
&sheet.SetCellNumber(1, 2, 1);
&sheet.SetCellNumber(1, 3, 2.2);
&sheet.SetCellNumberFormat(1, 4, 3.3, "00.000");
&sheet.SetCellString(1, 5, "3.3");
&sheet.SetCellFormula(2, 1, "=b1+c1");
&sheet.SetCellFormula(2, 2, "c1+d1");
&sheet.SetCellBoolean(2, 3, True);
&sheet.SetCellBoolean(2, 4, False);
&sheet.SetCellString(2, 5, "Y");
&sheet.SetCellHyperlink(3, 1, "CY2", "https://cy2.nl");
&sheet.SetCellHyperlink(3, 2, "", "");
&sheet.SetCellDate(4, 1, Date3(2020, 1, 1));
&sheet.SetCellDateTime(4, 2, DateTime6(2020, 1, 1, 1, 2, 3));
&sheet.CreateSheet("test2");
&sheet.RenameSheet("test2", "other");
&sheet.SelectSheet("other");
&sheet.Save();

/* yeah, make a test frameworj :) */
import CY2_SPREADSHEET:Workbook;

Local string &path = "c:\temp\test.xlsx";

Local CY2_SPREADSHEET:Workbook &sheet = create CY2_SPREADSHEET:Workbook(&path);
&sheet.SelectSheet("test");
Local string &string = &sheet.GetCellString(1, 1);
If &string <> "test" Then
   MessageBox(0, "", 0, 0, "cell(1,1) <> 'test', got: " | &string);
End-If;

&string = &sheet.GetCellString(1, 2);
If &string <> "1" Then
   MessageBox(0, "", 0, 0, "cell(1,2) <> '1', got: " | &string);
End-If;

&string = &sheet.GetCellString(1, 3);
If &string <> "2.2" Then
   MessageBox(0, "", 0, 0, "cell(1,3) <> '2.2', got: " | &string);
End-If;

&string = &sheet.GetCellString(1, 4);
If &string <> "3.3" Then
   MessageBox(0, "", 0, 0, "cell(1,4) <> '3.3', got: " | &string);
End-If;

&string = &sheet.GetCellString(2, 1);
If Upper(&string) <> "B1+C1" Then
   MessageBox(0, "", 0, 0, "cell(2,1) <> 'b1+c1', got: " | &string);
End-If;

&string = &sheet.GetCellString(2, 2);
If Upper(&string) <> "C1+D1" Then
   MessageBox(0, "", 0, 0, "cell(2,2) <> 'c1+d1', got: " | &string);
End-If;

&string = &sheet.GetCellString(2, 3);
If &string <> "TRUE" Then
   MessageBox(0, "", 0, 0, "cell(2,3) <> 'TRUE', got: " | &string);
End-If;

&string = &sheet.GetCellString(2, 4);
If &string <> "FALSE" Then
   MessageBox(0, "", 0, 0, "cell(2,4) <> 'FALSE', got: " | &string);
End-If;

&string = &sheet.GetCellString(3, 1);
If &string <> "CY2" Then
   MessageBox(0, "", 0, 0, "cell(3,1) <> 'CY2', got: " | &string);
End-If;

&string = &sheet.GetCellString(4, 1);
If &string <> "01/01/2020 00:00:00" Then
   MessageBox(0, "", 0, 0, "cell(4,1) <> '01/01/2020 00:00:00', got: " | &string);
End-If;

&string = &sheet.GetCellString(4, 2);
If &string <> "01/01/2020 01:02:03" Then
   MessageBox(0, "", 0, 0, "cell(4,2) <> '01/01/2020 01:02:03', got: " | &string);
End-If;

Local number &number;
Local boolean &success = &sheet.GetCellNumber(1, 2, &number);
If Not &success Or
      &number <> 1 Then
   MessageBox(0, "", 0, 0, "cell(1,2) <> 1, got: " | &number);
End-If;

&success = &sheet.GetCellNumber(1, 3, &number);
If Not &success Or
      &number <> 2.2 Then
   MessageBox(0, "", 0, 0, "cell(1,3) <> 2.2, got: " | &number);
End-If;

&success = &sheet.GetCellNumber(1, 4, &number);
If Not &success Or
      &number <> 3.3 Then
   MessageBox(0, "", 0, 0, "cell(1,4) <> 3.3, got: " | &number);
End-If;

&success = &sheet.GetCellNumber(1, 5, &number);
If Not &success Or
      &number <> 3.3 Then
   MessageBox(0, "", 0, 0, "cell(1,5) <> 3.3, got: " | &number);
End-If;

Local boolean &boolean;
&success = &sheet.GetCellBoolean(2, 3, &boolean);
If Not &success Or
      &boolean <> True Then
   MessageBox(0, "", 0, 0, "cell(2,3) <> true, got: " | &boolean);
End-If;

&success = &sheet.GetCellBoolean(2, 4, &boolean);
If Not &success Or
      &boolean <> False Then
   MessageBox(0, "", 0, 0, "cell(2,4) <> false, got: " | &boolean);
End-If;

&success = &sheet.GetCellBoolean(2, 5, &boolean);
If Not &success Or
      &boolean <> True Then
   MessageBox(0, "", 0, 0, "cell(2,5) <> true, got: " | &boolean);
End-If;

&success = &sheet.GetCellBoolean(1, 2, &boolean);
If Not &success Or
      &boolean <> True Then
   MessageBox(0, "", 0, 0, "cell(1,2) <> true, got: " | &boolean);
End-If;

Local datetime &datetime;
&success = &sheet.GetCellDateTime(4, 1, &datetime);
If Not &success Or
      Year(&datetime) <> 2020 Or
      Month(&datetime) <> 1 Or
      Day(&datetime) <> 1 Or
      Hour(&datetime) <> 0 Or
      Minute(&datetime) <> 0 Or
      Second(&datetime) <> 0 Then
   MessageBox(0, "", 0, 0, "cell(4,1) <> 01/01/2020 00:00:00, got: " | &datetime);
End-If;

&success = &sheet.GetCellDateTime(4, 2, &datetime);
If Not &success Or
      Year(&datetime) <> 2020 Or
      Month(&datetime) <> 1 Or
      Day(&datetime) <> 1 Or
      Hour(&datetime) <> 1 Or
      Minute(&datetime) <> 2 Or
      Second(&datetime) <> 3 Then
   MessageBox(0, "", 0, 0, "cell(4,1) <> 01/01/2020 01:02:03, got: " | &datetime);
End-If;
